var scriptProperties = PropertiesService.getScriptProperties();
scriptProperties.setProperty("currentEvent", "IEEE SmartCities");
scriptProperties.setProperty("currentTopic", "Entrepreneurship");
scriptProperties.setProperty("currentQuestion", "What do you think the best question is with respect to entrepreneurship?");
scriptProperties.setProperty("currentForm", "None");
scriptProperties.setProperty("latestResults", "");

/**
 * Return script data
 */
function getData() {
  return scriptProperties.getProperties();
}

/**
 * Get the URL for the Google Apps Script running as a WebApp.
 */
function getScriptUrl() {
 var url = ScriptApp.getService().getUrl();
 return url;
}

/**
 * Get "home page", or a requested page.
 * Expects a 'page' parameter in querystring.
 *
 * @param {event} e Event passed to doGet, with querystring
 * @returns {String/html} Html to be served
 */
function doGet(e) {
  Logger.log( Utilities.jsonStringify(e) );

  var template;

  // Event parameter
  var event = "IEEE SmartCities";
  if (e.parameter['event']) {
    scriptProperties.setProperty("currentEvent", e.parameter['event']);
    event = e.parameter['event'];
  }

  // Set current round
  setCurrentRound(event);
  // Get current form
  getCurrentForm(event);

  // Page
  if (!e.parameter.page) {
    // When no specific page requested, return "home page"
    template = HtmlService.createTemplateFromFile('index');
  }
  else {
    if (e.parameter.page == "results") {
      testData = getLatestRatingResults(event);
      scriptProperties.setProperty("testeGabi", "ola");
    }

    // use page parameter to pick an html file from the script
    template = HtmlService.createTemplateFromFile(e.parameter['page']);
  }

  template.data = getData();

  return template.evaluate().setSandboxMode(HtmlService.SandboxMode.IFRAME);
}

function moveRootFileToFolder(filename, foldername)
{
  var folders = DriveApp.getFoldersByName(foldername)
  var folder = folders.next();
  var files = DriveApp.getRootFolder().getFilesByName(filename)
  var file = files.next();
  folder.addFile(file);
  DriveApp.getRootFolder().removeFile(file);
  return file.getUrl();
}


/**
 * Create first form of the event
 */
function makeStartForm(class, title, question)
{
  DriveApp.createFolder(class);

  var fileName = "Round" + 1;

  var form = FormApp.create(fileName + "ContentForm");
  form.setTitle(title);
//  form.addTextItem().setTitle('Name').setRequired(true);
//  form.addTextItem().setTitle('Email').setRequired(true);
  form.addTextItem().setTitle(question).setRequired(true);

  var ssDest = SpreadsheetApp.create(fileName + "ContentResults");
  form.setDestination(FormApp.DestinationType.SPREADSHEET, ssDest.getId());

  // Move file to folder
  moveRootFileToFolder(fileName + "ContentResults", class);
  moveRootFileToFolder(fileName + "ContentForm", class);

  // Published URL
  scriptProperties.setProperty("currentForm", form.getPublishedUrl());
  return setCurrentRound(class);
}

/**
 * Create rating form based on input data from last round
 */
function makeRatingForm(class, round)
{
  var fileName = "Round" + round;

  var sourceFiles = DriveApp.getFilesByName(fileName + "ContentResults")
  var ss = SpreadsheetApp.open(sourceFiles.next());
  var ssSheet = ss.getActiveSheet();
  var form = FormApp.create(fileName + "RatingForm");

  form.setShuffleQuestions(true);
  form.setTitle("Rate the first 5 community responses below then click submit.")
//  form.addTextItem().setTitle('Name').setRequired(true);
//  form.addTextItem().setTitle('Email').setRequired(true);
  form.setShowLinkToRespondAgain(false);

  // TODO: get X random top entries and only rate those

  for (var i=2; i<=ssSheet.getLastRow(); i++) {
    var item = form.addScaleItem();
    item.setTitle(ssSheet.getRange("B" + i).getValue()).setBounds(1, 5);
  }

  var ssDest = SpreadsheetApp.create(fileName + "RatingResults");
  form.setDestination(FormApp.DestinationType.SPREADSHEET, ssDest.getId());

  // Move file to folder
  moveRootFileToFolder(fileName + "RatingResults", class);
  moveRootFileToFolder(fileName + "RatingForm", class);

  // Published URL
  scriptProperties.setProperty("currentForm", form.getPublishedUrl());
  return setCurrentRound(class);
}


function calculateRatingResults(class, round) {
  var fileName = "Round" + round;

  var sourceFiles = DriveApp.getFilesByName(fileName + "RatingResults");
  var ss = SpreadsheetApp.open(sourceFiles.next());
  var ssSheet = ss.getActiveSheet();
  var r = ssSheet.getDataRange();

  var totals = new Array();
  var maxCol = 0;
  var currentMax = 0;

  // Calculate best rated answer
  for (col = 2; col <= ssSheet.getLastColumn(); col++) {
    var total = 0;

    // Calculate total votes for this answer
    for (row = 2; row <= ssSheet.getLastRow(); row++) {
      var c = r.getCell(row, col);
      if (!c.isBlank()) {
        var currentVal = r.getCell(row, col).getValue();
        total = total + currentVal;
      }
    }

    // Store answer and total votes
    totals.push(new Array(r.getCell(1, col).getValue(), total));

    // If best rated, update max
    if (total > currentMax) {
     currentMax = total;
     maxCol = col;
    }
  }

  // Get text of best rated answer
  var bestRatedAnswer;
  if (!r.getCell(1, maxCol).isBlank())
    bestRatedAnswer = r.getCell(1, maxCol).getValue();

  // Update script data
  scriptProperties.setProperty("latestRatingResults", Utilities.jsonStringify(totals));
  scriptProperties.setProperty("latestBestRatedAnswer", bestRatedAnswer);
  return getData();
}


/**
 * Identify current round and trigger action for the next one
 */
function getLatestRatingResults(class) {

  var data = setCurrentRound(class);

  // Get latest results
  if (data.currentRoundType == "Rating answers") {
    scriptProperties.setProperty("latestRatingResults", "Going to calculate");
    return calculateRatingResults(class, parseInt(data.currentRoundNumber));
  }
  else {

    if (data.currentRoundType == "Not started") {
      scriptProperties.setProperty("latestRatingResults", "Not started");
    }
    else if (data.currentRoundType == "Receiving answers") {
      scriptProperties.setProperty("latestRatingResults", "The latest round was not rating");
    }
    return getData();

  }
}



/**
 * Create form with custom question, based on most rated data from last round
 */
function makeOutputForm(class, round, question)
{
  data = calculateRatingResults(class, round);

  // Create form and results spreadsheet
  fileName = "Round" + (round + 1);

  var form = FormApp.create(fileName + "ContentForm");
  form.setTitle("Best rated answer: "+data.latestBestRatedAnswer);
//  form.addTextItem().setTitle('Name').setRequired(true);
//  form.addTextItem().setTitle('Email').setRequired(true);
  form.addTextItem().setTitle(question).setRequired(true);

  var ssDest = SpreadsheetApp.create(fileName + "ContentResults");
  form.setDestination(FormApp.DestinationType.SPREADSHEET, ssDest.getId());

  // Move files to folder
  moveRootFileToFolder(fileName + "ContentResults", class);
  moveRootFileToFolder(fileName + "ContentForm", class);

  // Published URL
  scriptProperties.setProperty("currentForm", form.getPublishedUrl());
  return setCurrentRound(class);
}


/**
 * Set current round in the script properties
 */
function setCurrentRound(class) {
  // Determine round
  var folders = DriveApp.getFoldersByName(class);
  var round = 0;

  // Round 0 (not started)
  if (!folders.hasNext()) {
    scriptProperties.setProperty("currentRoundType", "Not started");
  }
  else {
    // Search for files
    var folder = folders.next();
    while (folder.getFilesByName("Round" + (round + 1) + "ContentResults").hasNext()) {
      round++;
    }

    scriptProperties.setProperty("currentRoundNumber", round);

    if (!folder.getFilesByName("Round" + round + "RatingForm").hasNext()) {
      scriptProperties.setProperty("currentRoundType", "Receiving answers");
    }
    else { 
      scriptProperties.setProperty("currentRoundType", "Rating answers");
    }
  }

  scriptProperties.setProperty("currentRoundNumber", round);

  return getData();
}

/**
 * Identify current round and trigger action for the next one
 */
function nextRound(class, title, question) {

  var data = setCurrentRound(class);

  if (data.currentRoundType == "Not started") {
    return makeStartForm(class, title, question);
  }
  else if (data.currentRoundType == "Receiving answers") {
    return makeRatingForm(class, parseInt(data.currentRoundNumber));
  }
  else {
    return makeOutputForm(class, parseInt(data.currentRoundNumber), question);
  }
}


/**
 * Identify current round and get current form URL
 */
function getCurrentForm(class) {
  // Determine round
  var folders = DriveApp.getFoldersByName(class);

  // Round 0 (not started)
  if (!folders.hasNext()) {
    return "";
  }
  else {
    // Search for content forms
    var folder = folders.next();
    var round = 0;
    var currentForm;
    var contentForm = folder.getFilesByName("Round" + (round + 1) + "ContentForm");
    while (contentForm.hasNext()) {
      round++;
      currentForm = contentForm.next();
      contentForm = folder.getFilesByName("Round" + (round + 1) + "ContentForm");
    }

    // Content form followed by rating form
    var ratingForm = folder.getFilesByName("Round" + round + "RatingForm");
    if (ratingForm.hasNext()) {
      currentForm = ratingForm.next();
    }

    // Get published URL of current form
    var ff = FormApp.openByUrl(currentForm.getUrl());
    scriptProperties.setProperty("currentForm", ff.getPublishedUrl());

    return scriptProperties.getProperty("currentForm");
  }
}

